import axios from 'axios'
import env from 'react-dotenv'
import React, {useState, useEffect} from 'react'
import {Link} from 'react-router-dom'
import PieChart from '../components/PieChart'

export default function NutritionSummary(props) {

    const [average, setAverage] = useState({})

    console.log(props)

    const fetchNutrLogs = async () =>{
        try{
            let response = await axios.get(`${env.BACKEND_URL}/nutrition`, {
                headers: {
                    'Authorization': props.user
                }
            })

        }catch(error){
            console.log(error)
        }
    }

   return (
       <div className='nutrSumPage'>
           <div className='chart'>
               <PieChart protein={30} fats={30} carbs={40}/>
               <div className='chartTitle'>
                   <div>Recommended</div>
                   <div>Daily Nutrition</div>
               </div>
           </div>
           <div className='chart'>
               <div className='chartTitle'>
                   <div>{props.user.username}'s</div>
                   <div>Average Daily Nutrition</div>
               </div>
               <PieChart protein={20} fats={15} carbs={65}/>
           </div>
           <div className='buttonHolder'>
               <Link to={{
                           pathname:'/',
                           state: {user: props.user}
                       }}
                   className='button'>Daily Logs &rarr;</Link>
           </div>
       </div>
   )
}
